/** @format */

import React from "react";
import "./App.css";
import Navbar from "./components/navbar";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      repos: [],
      active: "all"
    };
  }

  render() {
    return (
      <div>
        <Navbar />
      </div>
    );
  }
}
export default App;
